import React from 'react';

import {SideBarContainer, Icon, CloseIcon, SideBarWrapper, SideBarMenu, SideBarLink, BtnWrap} from './SideBarElements'; 
import {Button} from '../Button/ButtonElements';

const SideBar = ({isOpen, toggle}) => {
    return (
        <SideBarContainer isOpen={isOpen} onClick={toggle}>
            <Icon onClick={toggle}>
                <CloseIcon/>
                <SideBarWrapper>
                    <SideBarMenu>
                        <SideBarLink>

                        </SideBarLink>
                    </SideBarMenu>
                    <BtnWrap>
                        <Button primary='true' round='true' big='true'>Contact Us</Button>
                    </BtnWrap>
                </SideBarWrapper>
            </Icon>

        </SideBarContainer>
    );
};

export default SideBar;
